	<main>
		<ServHead />
		<Main>
			<div className="lh-title">
				<p className="f1 fw7 futura pb3">Design</p>
				<a
					href="#"
					className="link mw5 dt hide-child br2 cover bg-center"
					styles={{
						backgroundImage: `url($http://mrmrs.github.io/images/0010.jpg)`,
