				>
					<span className="white dtc v-mid w-100 h-100 child bg-black-40 pa5">
						Card title
					</span>
				</a>
				<p className="f1 fw7 futura pv3">Fotografia</p>
				<p className="f25 fw2 futura pv2">Immagini coordinate</p>
			</div>
		</Main>
	</main>
);
